import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useLocation } from 'react-router-dom';

const Params = () => {
    const [params, setParams] = useState(null);
    const location = useLocation();
    const data = location.state;
    const token = data.token;
    const chain = data.chain;
    const dsttoken = data.dsttoken;
    const dstchain = data.dstchain;
    const qty = data.quantity;
    // 1000000000000000000

    useEffect(() => {
        const fetchParams = async () => {
            try {
                const response = await axios.get(`https://aggregator-api.xy.finance/v1/buildTx?srcChainId=${chain}&srcQuoteTokenAddress=${token}&srcQuoteTokenAmount=${qty}&dstChainId=${dstchain}&dstQuoteTokenAddress=${dsttoken}&slippage=1&receiver=0xb6EFA1C3679f1943f8aC4Fc9463Cc492435c6C92&bridgeProvider=yBridge&srcBridgeTokenAddress=0x94b008aA00579c1307B0EF2c499aD98a8ce58e58&dstBridgeTokenAddress=0x55d398326f99059fF775485246999027B3197955&affiliate=0x90d67a9eaC7324A1a2942D6Dea9f6174Ad6048c9&commissionRate=100000&srcSwapProvider=OKX+DEX&dstSwapProvider=OKX+DEX`, {
                    headers: {},
                });
                setParams(response.data);
            } catch (error) {
                console.error('Error fetching params:', error);
            }
        };

        fetchParams();
    }, [token, chain, quote]);

    return (
        <div>
            <h1>Transaction Parameters</h1>
            {params && (
                <div>
                    <p>Gas needed: {params.gas}</p>
                    {/* Display other parameters as needed */}
                </div>
            )}
        </div>
    );
};

export default Params;
